package com.clei.utils;

import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

import java.io.*;

public class Base64Util {

    public static void main(String[] args) throws Exception {
        String base64Str = "\\u003d";
        base64ToFile(base64Str,"D:\\files\\xxx.pdf");
    }

    public static String base64encode(byte[] bytes) throws Exception {
        return new BASE64Encoder().encode(bytes);
    }

    public static byte[] base64decode(String str) throws Exception {
        return new BASE64Decoder().decodeBuffer(str);
    }

    public static void base64ToFile(String str,String filePath) throws Exception {
        byte[] bytes = base64decode(str);
        byteToFile(bytes,filePath);
    }

    public static void byteToFile(byte[] bytes,String filePath) throws Exception {
        File file = new File(filePath);
        if(!file.exists()){
            file.getParentFile().mkdirs();
            file.createNewFile();
        }
        FileOutputStream fos = new FileOutputStream(file);
        BufferedOutputStream bos = new BufferedOutputStream(fos);
        bos.write(bytes);
        bos.flush();
        bos.close();
    }
}
